import "./styles/App.scss";
import Button from "./components/Button";
import { useEffect, useState } from "react";
import { getMenuElements } from "./api/getMenuElements";

interface IMenuItemsProps {
  item: any;
}

function MenuItems({ item }: IMenuItemsProps) {
  const [menuElement, setMenuElement] = useState<any>();

  useEffect(() => {
    const fetchData = async () => {
      let resultMenuElements = await getMenuElements();
      setMenuElement(resultMenuElements);
    };
    fetchData();
  }, []);

  console.log(menuElement);
  return (
    <div className="menu-items">
      <header className="header">
        <div className="header-top">
          <img
            src="http://localhost:1337/uploads/roquette_logo_edeb6876e0.webp"
            className="App-logo"
            alt="logo"
          />
          <div className="right-part">
            <Button color="#2d5481" label="Moteur produit" />
            <Button color="#84b553" label="Trouver un document" />
          </div>
        </div>
        <div className="header-bottom">
          {menuElement.map((item) => (
            <MenuItems item={item} />
          ))}
        </div>
      </header>
    </div>
  );
}

export default MenuItems;
